import React from "react";
import { Col, Container, Row, Card } from "react-bootstrap";

import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import MensImage from "../assets/essential-captoe.png";
import BagImage from "../assets/RyanHunter/IMG_2685.JPG";
import FeatureImage from "../assets/RyanHunter/layercakexjm-19.JPG";

const CollabPage = () => {
  return (
    <motion.div
      initial={{ opacity: 0, y: -50 }}
      animate={{ opacity: 1, y: 0 }}
      fluid
      className="justify-content-center align-center container"
    >
      <Row noGutters={true} xs={1} md={1} lg={1} className="w-100">
        <Col>
          <motion.div
            whileHover={{ scale: 1.1 }}
            className="card"
            as={Link}
            to="/collabdetail"
            border="light"
            style={{ color: "#1f1f1f" }}
          >
            <Card.Img
              thumbnail
              src={FeatureImage}
              width={100}
              alt="Card image"
            />
            <Card.ImgOverlay bg="dark">
              <Card.Text className="text-left text-uppercase">
                <h5>LayerCake Los Angeles</h5>
              </Card.Text>
            </Card.ImgOverlay>
          </motion.div>
        </Col>
        <Row noGutters={true}  className="pt-2 d-flex ml-auto" xs={12} md={2} lg={2}>
          <Col>
            <motion.div
              whileHover={{ scale: 1.1 }}
              border="light"
              className="w-100 h-100 card"
              style={{ width: "100%" }}
            >
              <Card.Img
                src={BagImage}
                width="100%"
                height="100%"
                alt="Card image"
                style={{ objectFit: "cover" }}
              />
              <Card.ImgOverlay>
                <Card.Title className="text-left text-uppercase">
                  Ryan Hunter
                </Card.Title>
              </Card.ImgOverlay>
            </motion.div>
          </Col>
          <Col>
            <motion.div
              whileHover={{ scale: 1.1 }}
              className="card"
              border="light"
            >
              <Card.Img
                src={MensImage}
                width="100%"
                height="100%"
                alt="Card image"
                className="p-2 pt-5"
              />
              <Card.ImgOverlay>
                <Card.Title className="text-left text-uppercase">
                  Exchange LA
                </Card.Title>
              </Card.ImgOverlay>
            </motion.div>
          </Col>
        </Row>
      </Row>
    </motion.div>
  );
};

export default CollabPage;
